Patch Set 1: Code-Review+1

schema.cc has this in it:

  // In a new schema, we typically would start assigning column IDs at 0. However, this
  // makes it likely that in many test cases, the column IDs and the column indexes are
  // equal to each other, and it's easy to accidentally pass an index where we meant to pass
  // an ID, without having any issues. So, in DEBUG builds, we start assigning columns at ID
  // 10, ensuring that if we accidentally mix up IDs and indexes, we're likely to fire an
  // assertion or bad memory access.
  #ifdef NDEBUG
  static const ColumnId kFirstColumnId(0);
  #else
  static const ColumnId  kFirstColumnId(10);
  #endif

This tells me that we had no coverage for the SplitKeyRange API, or at least no coverage for requests with real projections. Is that true?

Patch Set 6:

(2 comments)

The jsonwriter-test.cc failure is the simplest to reproduce. I also managed to reproduce it in an isolated test case:

  $ cat test.cc
  #include <iostream>
  #include <string>

  #include <rapidjson/writer.h>
  #include <rapidjson/internal/dtoa.h>

  int main(int argc, char* argv[]) {
    double v = 11.0;
    char buffer[25];
    char* end = rapidjson::internal::dtoa(v, buffer);
    std::string s(buffer, end - buffer);
    std::cout << s << std::endl;
    return 0;
  }

  $ clang++ test.cc -o test -I/home/adar/Source/kudu/thirdparty/installed/common/include && ./test
  11.0

  $ clang++ -fsanitize=integer test.cc -o test -I/home/adar/Source/kudu/thirdparty/installed/common/include && ./test

 /home/adar/Source/kudu/thirdparty/installed/common/include/rapidjson/internal/ 
dtoa.h:88:16: runtime error: unsigned integer overflow: 4294967292 + 4 cannot be represented in type 'unsigned int'
  11.0

Note that I couldn't reproduce this using the top of master in the rapidjson source repo:

$ clang++ -fsanitize=integer test.cc -o test -I/home/adar/Source/rapidjson/include && ./test
11.0

So we should bisect the repo and figure out which post-1.1.0 patch fixed this, then include that patch in our local version of rapidjson 1.1.0.
